Een ex-gevangene verhuist naar een heel oud apartementencomplex, waar hij probeert het beste ervan te maken. Maar dan maakt hij 
kennis met een mysterieuze politieagent, die samen met zijn vrouw en dochtertje ook in het complex woont. Het duurt vervolgens 
niet lang voordat de ex-gevangene ontdekt dat er iets vreemds aan de hand is.
